import React,{useEffect, useState} from 'react'
import Home from './Home'
import Table from 'react-bootstrap/Table';
import Container from 'react-bootstrap/Container';
import ProgressBar from 'react-bootstrap/ProgressBar';
import TicketDetails from './TicketDetails'
import './App.css'


import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";


function TicketList() {
	const [show, setShow] = useState();
	const [loading, setLoading] = useState(true);
	const [data, setData] = useState([]);

	const columns = [
		{
			dataField: "id",
			text:"ID",
			sort: true
		},
		{
			dataField: "subject",
			text:"Subject",
			sort: true
		},
		{
			dataField: "status",
			text:"Status",
			sort: true
		},
		{
			dataField: "priority",
			text:"Priority",
			sort: true
		},
		{
			dataField: "tags",
			text:"Tags",
			sort: true
		},
		{
			dataField: "created_at",
			text:"Created",
			sort: true
		},
		{
			dataField: "updated_at",
			text:"Updated",
			sort: true
		},

	]

	const sizePerPageList = [
		{
		  text: '5', value: 5
		}, {
		  text: '10', value: 10
		}, {
		  text: '20', value: data.length
		},
		{
		  text: 'All', value: data.length
		}  
	]


	useEffect(()=>{

		const url = "http://localhost:3000/api/v1/base";
	    	fetch(url, {
			  "method": "GET",
			})
			.then(response => response.json())
			.then(response => {
			  setData(response.tickets); 
			  setLoading(false);
			})
			.catch(err => { console.log(err); 
			})

	}, []);

	return	!loading ? 
			<>

				<Container>	
				 <BootstrapTable
			        bootstrap4
			        keyField="id"
			        data={data}
			        columns={columns}
			        pagination={paginationFactory({ sizePerPage: 20 , sizePerPageList: [{
  text: '5th', value: 5
}, {
  text: '10th', value: 10
}, {
  text: '20th', value: 20
} ]})}
			      />
				<Table responsive bordered hover>
				  <thead>
				    <tr>
				      <th>ID</th>
				      <th>Subject</th>
				      <th>Status</th>
				      <th>Priority</th>
				      <th>Tags</th>
				      <th>Created</th>
				      <th>Updated</th>
				    </tr>
				  </thead>
				  <tbody>
				  	{
						data.map((d) => (
							<tr>
							<td>{d.id}</td>
							<td>{d.subject}</td>
							<td>{d.status}</td>
							<td>{d.priority}</td>
							<td>{d.tags}</td>
							<td>{d.created_at}</td>
							<td>{d.updated_at}</td>
							</tr>
						))
					}

				  </tbody>
				</Table>
				</Container>

				{show && <TicketDetails>{show} </TicketDetails>}	
			</>
			:
			<Container className="header">
				<h4>Loading Data</h4>
				<ProgressBar animated now={45} />
			</Container>

}


export default TicketList
